import React from "react";
import Contactbox from "./Contactbox";
import ContactForm from "./ContactForm";
import Jumbotron from "../partials/Jumbotron";
import Container from "react-bootstrap/esm/Container";
import Col from "react-bootstrap/esm/Col";
import {
    PinMapFill,
    TelephoneInboundFill,
    EnvelopeFill
} from "react-bootstrap-icons";
import Row from "react-bootstrap/Row";
import Map from "./Map";

const Contact = () => {
    return (
        <main>
            <Jumbotron title="Contact Us" />
            <Container className="p-5">
                <h3 className="text-center display-4">We're Local</h3>
                <Row>
                    <Col md={4}>
                        <ul className="d-flex flex-column align-items-center justify-content-between text-center fs-5 border border-2 border-danger contact-box rounded p-3">
                            <Contactbox
                                icon=<PinMapFill className="display-4" />
                                text="1317 W Airline Hwy, Suite L Laplace, La 70068"
                            />

                            <Contactbox
                                icon=<TelephoneInboundFill className="display-4" />
                                text="1-504-858-3697"
                            />
                            <Contactbox
                                icon=<EnvelopeFill className="display-4" />
                                text="calebrasheartcpr@gmail.com"
                            />
                        </ul>
                    </Col>
                    <Col md={8}>
                        <Map />
                    </Col>
                </Row>
            </Container>
            <ContactForm />
        </main>
    );
};

export default Contact;
